import{_get as e}from"../_modules/get/get.min.js";export function newSearch(){location.reload()}export async function getSubmissionData(){document.getElementById("viewData").innerHTML="requesting...",e("/api/manage/list","viewData").then(e=>{for(var t="",n=e.length-1;n>=0;n--)t+=`<fieldset><span><span>ID:&emsp;${e[n].id}</span>&emsp;&emsp;<span><a href="/detail?id=${e[n].id}" style="all: unset; color: #2997FF; text-decoration: none;">View</a>&emsp;<span onclick="deleteSubmission(${e[n].id}, 'main${e[n].id}')" style="color: red" id="main${e[n].id}">Delete</span></span></span></fieldset>`;document.getElementById("resultsInsert").insertAdjacentHTML("afterbegin",t),document.getElementById("search").style.display="none",document.getElementById("results").style.display="flex"})}export async function deleteSubmission(t,n){document.getElementById(n).innerHTML="deleting...",e(`/api/manage/${t}/delete}`,n).then(e=>{3203===e.status&&(document.getElementById(n).innerHTML="deleted!")})}